export function home(state = {}, action) {
    switch (action.type) {
      case 'HOTEL_DATA': {
        const { results } = action;
        return Object.assign({}, state, { hotelList:results });
      }


      case 'ADD_ORGANIZATION':{
        const {organization} =action
        return Object.assign({}, state, {organization});
      }

      default:
        return state;
    }
  }
